"use es6";

import React from "react";
import stars from "../images/stars.png";
import stripes from "../images/stripes.png";
<script src="https://d3js.org/d3.v5.min.js" charset="utf-8"></script>;

const HomePage = () => {
  const starsstyle = {
    backgroundColor: "#000077",
    width: "fit-content",
    height: "fit-content",
  };

  const stripesstyle = {
    backgroundColor: "#770000",
    width: "fit-content",
    height: "fit-content",
  };

  var svgContainer = d3
    .select("#canvas")
    .append("svg")
    .attr("align", "center")
    .attr("width", 1105)
    .attr("height", 700);

  return (
    <>
      <div>
        <h1>HOME</h1>
        <div id="canvas" style="width: fit-content;"></div>
        <div style={starsstyle}>
          <img src={stars} alt={"stars"} />
        </div>
        <div style={stripesstyle}>
          <img src={stripes} alt={"stripes"} />
        </div>
      </div>
    </>
  );
};

export default HomePage;
